(114, 67, 33, 0, 44, 0, '', '2013-02-01', 8, '- Sviluppo componenti di selezione data: birthday, doc emission date, doc expiration date. Customizzazione dei componenti dipendenti dalla rotazione e dalla piattaforma (iphone, ipad)\n- bug fixing sul country selector', NULL),
(130, 67, 33, 0, 44, 0, '', '2013-02-04', 8, '- implementata possibilita'' di avere molteplici documenti per il passeggero; aggiunta logica sia nel backend che nei dto e nel frontend (pagina di dettaglio passeggero)\n\n- Rilevato un crash nello usercreditcardtask. Quando si interrompe la richiesta del booking, dal risultato della ricerca, iniziando improvvisamente una nuova ricerca, il creditcard non viene deallocato e si produce un memory leak con crash. Ho studiato il problema e l''ho fixato ridefinendo il self con __block prima della copia di un block dallo stack allo heap. Infatti ho rilevato che durante la copia stack heap se ci sono reference a self, viene eseguita una retain sul self, quindi il counter dello smart pointer sale di numero di copie dei blocks.\n\n- discussione con angelo per fixare e implementare nuova funzione javascript per detecting dei tipi di documento.\n\n- rimosso dal searchservice nel backend l'' hijacking a sviluppo (per il tag)\n\n- fixate localizzazioni sul tag/trunk riportati fixes sul tag, rilasciate su dropbox versioni finali prelease\n', NULL),
(162, 67, 33, 0, 44, 0, '', '2013-02-05', 8, '- aggiornamento tag con fix crash credit card\n- fix iphone close view nel passenger detail\n- sviluppo dialog in booking web page, se l'' utente vuole aggiornare i passeggeri\n- fixed autorotation bug iphone bpm view controller\n- sviluppo passenger backend per supportare nuove funzionalita frontend passenger detail e passenger automatic update\n- rilevato crash  durante la sequenza di booking nella web page, se l''utente cambia sezione (barra in basso) prima che appaia il task della credit card', NULL),
